R["oh__@dineneth"]="{['TS']=1728770171,['Key']='oh__@dineneth',['na']={[101]={['D']='My Necrom house is decorated as a noble\\'s living space, with servants\\' quarters, living space, treasury with its own entrance to special fencing services, entertaining spaces, and expanded outdoor space. Trying not to break the bank with this one, still a work in progress.',['C']=1.500000,['O']=19611,['N']='Necrom City House',},[71]={['D']='Probably will always be a work in progress, this is set up as an estate and getaway for just about anyone, including a druid\\'s cave for retreat, sunbathing and fishing spots, multiple meditation areas, lovely outbuildings functioning as estate rooms, crafting area, and a tower home ideal for entertaining with a view.',['C']=1.500000,['O']=19960,['N']='TranquilTown Retreat',},[105]={['D']='Not my primary residence, but one of my favorites, probably in my top 3. This druid home is full of natural beauty but with all the comforts of home and full crafting stations. Come see the waterfalls, stay in the guest suites, relax in the bathhouse, play a little Tribute, or just sit and stare at the trees. ',['C']=1.500000,['O']=19721,['N']='Druidic Grove',},[11]={['D']='My Swamp Castle (on the outside); it\\'s all about appearances. On the inside, it\\'s the same ol\\' mud hut.',['C']=1.500000,['O']=19959,['N']='False Pretenses',},[78]={['D']='A comfortable private home in the heart of Solitude',['C']=1.051000,['O']=19645,['N']='Solitude Townhouse',},[79]={['D']='The idea here is to make this big, scary monstrosity of an estate pretty and comfortable.',['C']=1.500000,['O']=19959,['N']='Beauty in Darkness',},[48]={['D']='My remote hall with living area, basement crafting, a unique bathhouse, and expansive grounds with outdoor dining, various sitting areas, fire circles, statuary, and such.',['C']=1.500000,['O']=19960,['N']='Stuff Everywhere',},[49]={['D']='I decided to make my Witches Hut into a pleasant little cottage oasis (yes, in the middle of  a bog... but still) with lots of flowers.',['C']=1.500000,['O']=19959,['N']='Not So Scary Hut',},[83]={['D']='Looking down over Markath in The Reach, this is one of my favorite properties. The interior is complete; outdoors is still a work in progress because it\\'s huge, but come see my greenhouse built out over the city, take a look at the various views, and play a hand of Tales of Tribute in its dedicated outdoor area.',['C']=1.500000,['O']=19658,['N']='Markarth Manor',},[54]={['D']='It\\'s a winter get-away with plenty of room for guests. Not a get-away-from-winter kind of house, but a I-want-to-go-freeze-in-my-winter-house kind of house. We have several beds, plenty of reading, visiting, and card-playing nooks, and if you follow the path out the back and around the mountainside, you can spend the night in our freezing but striking guesthouse location.',['N']='Frost Peak Retreat',['O']=20008,['C']=1.036000,},[24]={['D']='Come retreat from the happenings in Reapers March to spend a little time in the gaming hall, around the fire pit, reading upstairs in the reading nook, or just relaxing before your next adventure.',['C']=1.051000,['O']=19981,['N']='Reapers Retreat',},[110]={['D']='Come visit a working winery estate. We\\'re always looking for seasonal help; feel welcome to check out the winery workers\\' quarters. Stroll through the vineyards, picnic while watching the wine presses, enjoy wine tasting and camraderie in our tasting barn, or come inside to sit by the fire and read a book from one of our libraries, enjoy a fresh-made feast, or relax with a game of cards.',['C']=1.051000,['O']=20001,['N']='Colovian Winery',},[111]={['D']='Welcome to Flowerfalls, a cozy Auridon retreat with blooming gardens, comfortable dining area, private master suite, a cozy conversation area, quiet reading nook, and a guest dormitory for visiting garden enthusiasts.',['C']=1.051000,['O']=19981,['N']='Flowerfalls',},[91]={['D']='Visit the sumptuous Cascadia Serenity Estates, my primary home with plenty of room for guests needing respite from the world. Come have a sweetroll in the kitchen, study antiquities in the library, enjoy entertainment in the game room, or simply stroll through the peaceful gardens and watch the cascading waterfalls.',['C']=1.021000,['O']=20001,['N']='Cascadia Serenity',},[88]={['D']='I like to think this is how my house would actually be if I owned one like this. It\\'s not too cluttered, only half the furnishing placements available were used, but it\\'s pleasant and practical.',['C']=1.051000,['O']=19708,['N']='Leyawiin Bridge Home',},[103]={['D']='An oasis home, Sword-Singer\\'s Redoubt provides a cool break from the desert. Decorated as a large private home with much consideration for guests and areas of quiet contemplation. I\\'ve added a few rooms in the caverns to accomodate formal dining, kitchens, and a winch to bring up heavy objects from the water.',['C']=1.051000,['O']=20008,['N']='Glowing Cavern Oasis',},[30]={['D']='It\\'s always Autumn at the Old Mistveil Manor outside of Riften. We have multiple braziers inside to keep out the chill, a meal set for guests, indoor bathroom, pumpkins ready for picking, and a Tribute table set up on the porch. ',['C']=1.033000,['O']=19959,['N']='Pumpkin Spice House',},[63]={['D']='My year-round winter holiday / New Life Celebration home is in the Enchanted Snow Globe in Eastmarch. Come have some cookies and cocoa, sit around the bonfire, play a little Tales of Tribute, enjoy a meal, or read a book by the fire!',['C']=1.022000,['O']=19959,['N']='\"Merry New Life\"',},},['Version']=1773,}"
