R["oh__@mqqney"]="{['na']={[80]={['C']=1.500000,['N']='Casa del Freezerino',['O']=19972,['D']='this home is the first home that i have built from scratch. it was a challenging but rewarding project.\\nits basically a mountain retreat for those who enjoy the peace and quiet, and features a nice well stocked library to keep the mind limber during extended stays.',},[81]={['C']=1.030000,['N']='Hjaalmarch Gallery',['O']=19199,['D']='My latest and probably my favourite project yet, not a great deal of work in the yards and gardens, as I wanted to do something special with the interior of this one, and if you\\'re familiar with this homes original form, you\\'ll see what I mean.',},[98]={['C']=1.017000,['N']='Fortress Fogbreak',['O']=19520,['D']='This naturally defensible rock was originally the site of the lighthouse only, and has helped sailors to negotiate these tricky waters for a long time. Eventually the fortress was erected and troops garrisoned here to guard against the threat of seaborne invaders. Nowadays, the fort remains, but its purpose is once again strictly non military.',},[71]={['C']=1.003000,['D']='this is stage 1 of the giant hedge maze that I first conceived of a couple of years ago. I finally made it a reality! ',['O']=20003,['N']='Massive Maze',},[101]={['C']=1.050000,['N']='Clandestine Drug Lab',['O']=19972,['D']='',},[70]={['O']=19301,['N']='Rimmen Temple',},[55]={['C']=1.500000,['N']='Hacienda Napoles',['O']=19199,['D']='My first ever attempt at building/decorating. It started out as fairly unremarkable, then one day I wondered to myself....\"just how far will the game allow me to go, in terms of expansion\". This is what I discovered...',},},['TS']=1728341531,['Key']='oh__@mqqney',['Version']=1773,}"
