R["oh__@warsmith211"]="{['Version']=1773,['na']={[40]={['C']=1.031000,['N']='Tsyokawa Baths',['D']='Through a small cavern system, lies the Tsyokawa Baths. Open to nature itself, a waterfall meets a pool below and branches into two smaller waterways; one connecting to a small pond used for fish farming, and the other continues through the mountains to the market. Inside another small cave, geothermically heated pools provide warm relief to the body.',['O']=19957,},[18]={['C']=1.007000,['N']='Tsyokawa Tavern',['D']='Built outside the Akaviri village of Tsyokawa, the Iron Serpent Tavern is an establishment offering both Akaviri and more common Tamrielic food and drink, as well as accommodation. Built in a mix of common Cyrodillic architectural style and \\'Akaviri sensibilities\\'. Connects with Tsyokawa Hub via portal at entrance.',['O']=19957,},[70]={['O']=19957,['N']='Tsyokawa Farm \\'n Bar',['D']='Outside of Tsyokawa Hub, this serves as representation to the more common homes built in Tsyokawa: An earthen floor serves as entrance and storage, and an elevated wooden platform for living space. Its walls are made of a paper material which can be partitioned to open or close off. The Izakaya, an Akaviri-style bar, serves local residents primarily. A swordsmiths workshop is also present.',['C']=1.041000,},[110]={['O']=19893,['N']='Thunder Guard Temple',['D']='Built in the Colovian Highlands, Thunder Guard Temple once served as a Dragonguard Temple on the western borders of Reman Cyrodiil\\'s Empire. After being rediscovered, it and the lands around were set aside for an Akaviri colony under the administation of House Decentius. Connects to personal quarters (2nd floor center) and nearby village (entrance).\\r\\n+All homes listed by me available to RPers+',['C']=1.017000,},[71]={['O']=19957,['N']='Tsyokawa Hub',['D']='The village of Tsyokawa (\\'Capital River\\') serves as the hub for the colony of Takkadei. Built around Thunder Guard Temple by colonists from the village of Akariue in Elswyer, it is located within the Colovian Highlands in the land of Spartharia; under the control of House Decentius. The hub\\'s main purpose is a marketplace, but connects to other parts of the colony.',['C']=1.041000,},},['Key']='oh__@warsmith211',['TS']=1724360877,}"
