R["oh__@mesmerising"]="{['Version']=1773,['TS']=1720892657,['Key']='oh__@mesmerising',['eu']={[1]={['O']=19464,['C']=1.051000,['D']='Coziest prison cell.',['N']='Vulkhel Guard Inn',},[8]={['O']=19805,['C']=1.026000,['D']='A traditional cozy High Elf/Altmer home.',['N']='Eagle Roost',},[57]={['O']=19782,['C']=1.010000,['D']='Welcome to the now Grand Bazaar!\\r\\nFully decorated guild hall with all the neccessities. \\r\\n\\r\\nPlaza, Market, Shops, Crafting Stations, Garden, Beehives, Mundus Stones, Temple, Shrines, Training/Trial Dummies and more. ♪\\r\\n\\r\\n(Mostly Redguard and Elsweyr furnishing)',['N']='Not-So-Grand-Bazaar',},[59]={['O']=19689,['C']=1.007000,['D']='Lore-friendly inn. You\\'ll be greeted by a receptionist (I hope). Includes two rooms, one suite and all you can eat buffet. There\\'s also an outdoor tavern with a stunning view (mini-gryphon is a paid actor in that). Art corner for fashion creativity. And lastly, an enchanted fountain. \\n\\nHave fun!',['N']='Golden Feather Inn',},[4]={['O']=19682,['C']=1.007000,['D']='A simple Fisherman inn room.',['N']='Skywatch Apartment',},[62]={['O']=19917,['C']=1.020000,['D']='Not an art concept but rather an integration of some parts of Rivendell into the beautiful Artaeum villa.\\n\\nInspired by the Lord of The Rings & The Hobbit movies and Altmer lore/aesthetics.\\n\\n- There\\'s a figurne dispaly (in the library) of the Great War of the Ring in the Third Age.\\n\\n- A modest theatre of the House of Reveries, supervised by none other than Alchemy!\\n\\n- A weakling Ent target dummy, Aetherial Well and a Builds Changer NPC... if you feel like hitting innocent Ent saplings.\\n\\nWelcome!',['N']='Rivendell',},[39]={['O']=19859,['C']=1.007000,['D']='The mansion of a Mephala\\'s worshipper. Expect spiders!',['N']='Mephala Cult\\'s Lair',},},}"
