R["oh__@teddiepoe"]="{['Key']='oh__@teddiepoe',['na']={[49]={['N']='Gwenygail\\'s Hut',['O']=19858,['C']=1.038000,['D']='The former cottage of a Reach witch-turned-hagraven.',},[17]={['N']='Old Caves of Sna Lor',['D']='Intrepid explorers have just discovered the fabled caves of Sna Lor the Swift! Lucky visitors may catch a glimpse of the ghost of an unlucky soul who died down here years ago.',['C']=1.038000,['O']=19859,},[19]={['N']='Dutiful Bar & Grill',['O']=18751,['C']=1.024000,},},['TS']=1715899340,['Version']=1773,}"
R["oh__@mashia"]="{['Version']=1773,['eu']={[32]={['O']=19652,['C']=1.018000,['N']='Ilsebills Slot',['D']='„Mandje! Mandje! Timpe Te!\\r\\nButtje, Buttje in de See!\\r\\nMine Fru, de Ilsebill,\\r\\nWill nich so, as ick wol will.\"\\n„Na! wat will se denn?\" sed de Butt.\\n„Ach, sed de Mann, gans bedrövd, mine Fru will in een stenern Slott wanen.\"\\n„Ga man hen, se steit vör de Döör\" sed de Butt.\\n\\nMy build is not about becoming like God. My build is about what I would have done if I was an enchanted fish-prince and the wife of a fisherman wasn\\'t satisfied with my custom-made cottage and demanded a stone castle instead.',},[33]={['O']=19287,['C']=1.020000,['N']='Orkheim, neu bezogen',['D']='Ehrlich gesagt passt dieser Ort in keine der vorgeschlagenen Kategorien. Ist aber auch nicht schlimm, ein gemütliches Heim ist auch so schön. Muss ja nicht alles gleich in eine Schublade gesperrt werden, so kommt wenigstens etwas frische Luft dran.',},[34]={['O']=18994,['C']=1.035000,['N']='Woestijn',['D']='Ein kleiner privater Rückzugsort in der W��������ste',},[68]={['O']=19287,['C']=1.014000,['N']='Claudius Thermen',['D']='Meine Heimatstadt hat eine gute und dafür natürlich auch bekannte Therme. Es ist der einzige Ort, den ich kenne, an dem man ungestört und splitterfasernackt eine berühmte katholische Kirche betrachten kann - während man freudig von den Passagieren der darüber fahrenden Gondelbahn bejubelt wird. Ist schon eine spezielle Atmosphäre. Und schön ist es dort auch.',},[6]={['O']=19546,['C']=1.023000,['N']='Waiting Room',['D']='',},[7]={['O']=19275,['C']=1.028000,['N']='Assassins Sleep',['D']='After an argument with her former coadventurer about money, Nuzhimeh switches her job and joins the Dark Brotherhood. Her first assignment is an unhinged and sleep-deprived priest, which is an easy kill. Snuggling into her bed, she wonders why she got so much money for this easy deed and why the priest looked so relieved in his last second, but the sleep overwhelms her fast. She doesn\\'t notice the strange lights and sounds coming out of the garden...',},[8]={['O']=19546,['C']=1.021000,['N']='Wardens Garden',['D']='',},[73]={['O']=19546,['C']=1.050000,['N']='DRAGONS? HERE?',['D']='Tired of clumsy beasts stamping your front yard?\\r\\nTired of coming home to your cosy city home to find all that\\'s left are some smoking ruins? Stop buying some mouldy khajiit architecture.\\r\\nBuy a safe home.\\nChoose one of two Versions: >Economical< with tasteful advertising for our complete product range involved, or >Luxury< without advertising.\\r\\nBuy now, we can talk about the currency later.',},[10]={['O']=19287,['C']=1.030000,['N']='Hanging Gardens',['D']='My first home. I started housing with housing and there are a lot of new items which would fit this home perfectly... but... i like it the way it is.',},[11]={['O']=19546,['C']=1.017000,['N']='Charmings Castle',['D']='Okay, it was not you who saved the princess some months ago. It was this terrible charming prince. It should have been you. You wouldn\\'t have pinched your princess\\' buttocks, smirked, and crooned something about \"You you shall make me very happy.....\" She went with him. She hadn\\'t even looked at you, a good friend of many years. She hadn\\'t heard your objections. And this was the last time you heard from her.',},[13]={['O']=19547,['C']=1.019000,['N']='New Beginning',['D']='There are places only a few people dare to enter and even fewer are able to leave them – loaded with strange stories from strange encounters. And there are places nobody dares to enter: Only the stories trickle out, stuffed with mysteries and darkness, adventures and sudden deaths.\\nThis build is inspired by the story “the beast below” from Doctor Who.',},[14]={['O']=19496,['C']=1.007000,['N']='EHT Adventure 4Books',['D']='Hangover. You feel miserable and try to remember who you are. What the fuck are you doing here in the cellar? It must be daytime, you see sunbeams trying to fight their way through the dusty windows. Your heightened senses hear a knock on the main door upstairs. What to do now? Answer the door? Or take a run and escape through the trapdoor? If only you knew who you were and why you are here...\\n\\n-> I tried to create an EHT-Adventure. 4 books to read, 3 environment descriptions, 2 possible endings',},[16]={['O']=19725,['C']=1.022000,['N']='3. Weihnachtstag',['D']='Third day of Christmas\\r\\n\\r\\nThe smell of delicious, elaborately prepared food still permeates the house. All relatives have been visited, and all presents have been enthusiastically opened. There is new, exciting stuff everywhere. Finally, you have the time to enjoy it and relax after all the excitement.',},[17]={['O']=19546,['C']=1.051000,['N']='Kindergarten',['D']='',},[19]={['O']=19546,['C']=1.050000,['N']='Dutch Apartment',['D']='',},[22]={['O']=19546,['C']=1.051000,['N']='Business Consulting',['D']='Tired of being a small business? Tired of competing with other small businesses?\\r\\nI will help you grow. You choose what you want.\\r\\nA completely reliable analysis of the state of your business at the present, the future, and the past?\\r\\nMaybe a prediction of happy and unlucky turns, partnerships, and establishment of subsidiary companies?\\r\\nHow about lengthening the time your customers spend at your place with discreet and pleasant incense?\\r\\nTake your faith into your own hands!',},[23]={['O']=18994,['C']=1.050000,['N']='Hinterhofhäuschen',['D']='',},[26]={['O']=19859,['C']=1.026000,['N']='The Aunties',['D']='Please use a low gamma-setting.\\n\\nEverybody knows the aunties. They are a lovely older couple living on an old and a somewhat rundown Colovian estate. One of them inherited it from an even older and more rundown family, and they are living there for decades now.\\r\\n\\rThe estate is nothing special, some grapes on the hill behind the house, some chickens, pigs and a little apiary. They manage somehow to make ends meet and enjoy the life in the countryside.\\n(Two hidden rooms)',},[49]={['O']=19817,['C']=1.029000,['N']='The Village',['D']='This build is about the ex-neighbours of my family.\\r\\nIt is not historically accurate. History is great, but building should be fun.\\r\\nMy story is told from the perspective of the people who bought the village. In my version, they didn\\'t take the village apart for building material, but they decided to turn it into an open air museum.\\r\\nBecause I like open air museums.\\r\\nYou can find 7 texts to read and 1 secret.',},[28]={['O']=19570,['C']=1.033000,['N']='Geitengeluk',['D']='An old build – I have been waiting for two years now for the right round pillars with dark wooden texture to make it look perfect. Maybe we will get them someday. A few items are changed to shiny new stuff, but it\\'s mostly the same build :)',},[42]={['O']=19546,['C']=1.007000,['N']='Singing Guar',['D']='',},[30]={['O']=19543,['C']=1.047000,['N']='Haydens P(a)lace',['D']='This build was made for hayden as a nice and cosy place to relax, write letters to friends, read a lot of books, have tasty meals and hang around in the garden without doing anything for anybody :)\\r\\nIt is inspired by the Chinspuns great library. Go and visit it, it is worth your time.\\r\\nHave fun and goodbye',},[31]={['O']=19546,['C']=1.050000,['N']='Bungalow, modern',['D']='',},},['TS']=1715890134,['Key']='oh__@mashia',}"
