R["fx__eu__@mashia__49"]="{['Effects']={[1]={['Groups']=0,['X']=62992.513411,['Color']=979,['EffectType']=856,['Id']=1303,['SizeZ']=280,['Yaw']=6.108652,['Y']=11025,['SizeY']=280,['SizeX']=80,['Alpha']=1,['Roll']=0,['Pitch']=1.570971,['Z']=45429.478546,['MetaData']={['pattern scale % (y)']=50,['pattern scale % (x)']=50,},['Contrast']=0.800000,},[2]={['Groups']=0,['X']=62993.155909,['Color']=23,['EffectType']=856,['Id']=1312,['SizeZ']=283,['Yaw']=6.108652,['Y']=11024,['SizeY']=283,['SizeX']=83,['Alpha']=1,['Roll']=0,['Pitch']=1.570971,['Z']=45429.507694,['MetaData']={['pattern scale % (y)']=50,['pattern scale % (x)']=50,},['Contrast']=0.730000,},[3]={['Groups']=0,['Color']=727799,['EffectType']=599,['Id']=1315,['SizeZ']=60.679612,['Yaw']=6.063274,['Y']=11091.339806,['SizeY']=60.679612,['SizeX']=50,['Alpha']=1,['Roll']=0,['Pitch']=0,['Z']=45763.130858,['X']=62724.582368,['Contrast']=0.340000,},[4]={['Groups']=0,['Color']=6,['EffectType']=599,['Id']=1317,['SizeZ']=60.679612,['Yaw']=6.063274,['Y']=11092.339806,['SizeY']=60.679612,['SizeX']=50,['Alpha']=0.860000,['Roll']=0,['Pitch']=0,['Z']=45764.303214,['X']=62725.373304,['Contrast']=0.340000,},[5]={['Groups']=0,['X']=62721.209179,['Color']=102439,['EffectType']=8502,['Id']=1318,['SizeZ']=75,['Yaw']=2.925172,['Y']=11088,['SizeY']=75,['SizeX']=61.456456,['Alpha']=0,['Roll']=0,['Pitch']=0,['Z']=45764.814493,['MetaData']={['title']='Beer, Beer, Beer',['message']='A long time ago, way back in history\\n\\nWhen all there was to drink was nothin but cups of tea\\n\\nAlong came a man by the name of Charlie Mops\\n\\nAnd he invented a wonderful drink and he made it out of hops.\\n\\n\\n\\nHe must have been an admiral a sultan or a king\\n\\nAnd to his praises we shall always sing\\n\\nLook what he has done for us, he filled us up with cheer\\n\\nLord bless Charlie Mops, the man who invented beer beer beer\\n\\nTiddly beer beer beer\\n\\n\\n\\n\\nA bushel of malt, a barrel of hops, stir it around with a stick,\\n\\nThe type of lubrication to make your engine tick;\\n\\nForty pints of wallop a day will keep away the quacks,\\n\\nIt\\'s only eight pence halpenny a pint, and one and six in tax!',},['Contrast']=1,},[6]={['Groups']=0,['X']=63480.982544,['Color']=23,['EffectType']=856,['Id']=1322,['SizeZ']=283,['Yaw']=6.087708,['Y']=11030,['SizeY']=283,['SizeX']=83,['Alpha']=1,['Roll']=0,['Pitch']=1.570971,['Z']=45532.502045,['MetaData']={['pattern scale % (y)']=50,['pattern scale % (x)']=50,},['Contrast']=0.730000,},[7]={['Groups']=0,['X']=63480.065991,['Color']=979,['EffectType']=856,['Id']=1323,['SizeZ']=280,['Yaw']=6.091199,['Y']=11032,['SizeY']=280,['SizeX']=80,['Alpha']=1,['Roll']=0,['Pitch']=1.570971,['Z']=45532.775035,['MetaData']={['pattern scale % (y)']=50,['pattern scale % (x)']=50,},['Contrast']=0.800000,},[8]={['Groups']=0,['X']=65234.936099,['Color']=858585,['EffectType']=4408,['Id']=1326,['SizeZ']=53,['Yaw']=5.162684,['Y']=10664,['SizeY']=53,['SizeX']=220,['Alpha']=0.850000,['Roll']=0,['Pitch']=0.097738,['Z']=47409.508766,['MetaData']={['message']='The Village',},['Contrast']=0.610000,},[9]={['Groups']=0,['X']=65245.850865,['Color']=858585,['EffectType']=4408,['Id']=1327,['SizeZ']=163,['Yaw']=5.159193,['Y']=10564,['SizeY']=163,['SizeX']=492,['Alpha']=0.850000,['Roll']=0,['Pitch']=0.118682,['Z']=47415.220324,['MetaData']={['message']='1392 - First documented mention\\n\\n1653 - The Village is uninhabited for the first time after the Thirty Years\\' War\\n\\n1684 - Two fireplaces are mentioned at the Village. Life is back!\\n\\n29.03.1853 - The Village is finally abandoned. Everything the Villagers can\\'t take with them is sold to the neighbouring village.\\nThey start to take building materials from the houses.\\n\\nThe Villagers travel by foot to Koblenz. A ship takes them to Cologne, and they continue their journey by train.\\n\\n11.04.1853 - The Brigg \"Leander\" takes them from Bremen to New York\\n\\n30.05.1853 - They arrive in New York\\n\\nIn June 1853 - After a further journey by railway and steamboat, they arrive at their new homeland in Milwaukee, Wisconsin.',},['Contrast']=0.610000,},[10]={['Groups']=0,['X']=64880.526125,['Color']=466898,['EffectType']=8503,['Id']=1329,['SizeZ']=35,['Yaw']=2.691298,['Y']=10431,['SizeY']=35,['SizeX']=26.456456,['Alpha']=1,['Roll']=0,['Pitch']=1.577778,['Z']=47242.785801,['MetaData']={['title']='Diary',['message']='So much to do.\\n\\nToo much to do.\\n\\nI increasingly have the feeling that Thytis and I have completely misjudged the whole situation.\\n\\nBut then again - the village was dirt cheap.\\n\\nI still wonder why all these people suddenly abandoned their village.\\nIt\\'s actually quite cute, even if it\\'s a bit broken.\\n\\nIf we manage to renovate it, we\\'ll have made a great deal.\\nIf...\\n\\nHowever, many of the buildings have become unsafe.\\nWe also urgently need to replace the windows to prevent further moisture penetration.\\n\\nBut without more money, we can\\'t do anything any more.\\n\\nIt was definitely too early to open the open-air museum now.\\n\\nBut how else would we get money?',},['Contrast']=0.580000,},[11]={['Groups']=0,['X']=64634.702453,['Color']=385173,['EffectType']=8502,['Id']=1330,['SizeZ']=35,['Yaw']=0,['Y']=10441,['SizeY']=35,['SizeX']=26.456456,['Alpha']=1,['Roll']=0,['Pitch']=1.574287,['Z']=47707.573819,['MetaData']={['title']='Travelling when you are poor',['message']='The Brigg \"Leander\" was a three-master and 94 feet and 6 inches long and 27 feet and 4 inches wide.\\n\\nOn its journey of 49 days between Bremen and New York, it carried 117 Passengers.\\n\\nAround 30 people were accommodated in each of the ship\\'s small cabins.\\n\\nIt was surely no comfortable journey.\\n\\nBut nobody died.\\n\\nInstead, the Passenger-Number increased through one birth to 118.',},['Contrast']=0.680000,},[12]={['Groups']=0,['X']=64829.196012,['Color']=153934,['EffectType']=8503,['Id']=1333,['SizeZ']=35,['Yaw']=1.731367,['Y']=10441,['SizeY']=35,['SizeX']=26.456456,['Alpha']=1,['Roll']=0,['Pitch']=1.577778,['Z']=47456.949803,['MetaData']={['title']='About this build',['message']='This build is about the ex-neighbours of my granny.\\n\\nYou have to know that my granny really liked to hike long distances.\\nShe was the oldest (and maybe most active) member of her village\\'s hiking club.\\nI never understood why people liked to walk around in huge circles for no special reason.\\n\\nI always preferred climbing in trees or building ships, swords or Guinea pig houses\\n(I competed in all with my favourite cousin.\\nWe had a lot of Fun, especially when we tried to convince a Guinea pig to choose our house first).\\n\\nHiking took away the precious time I could spend in her workshop.\\n\\nBut she was a lovely lady and the landscape in the Westerwald is beautiful, so we got to some arrangement.\\n\\nWe made a short hike together, and I enjoyed complete freedom in the evening. We were both happy this way.\\n\\nMy favourite hike took me through beautiful woods filled with ancient crumbling stones to a place which was remarkably unspectacular.\\n\\nMy grandma told me that there was a village at this place once.\\nAnd that they all left everything behind and went away.\\nIt was hard to believe, because people in this area usually lived in or next to the village they were born.\\n\\nI stopped wondering when in 21.04.2003 some descendents of those adventurous villagers arrived at this place, dressed in old-fashioned clothing and partying hard with the descendents of their ex-neighbours.\\n\\nThis build is about why they left their village.\\n\\nMy little Eso-Village is not historically accurate.\\nHistory is great, but building should be fun.\\n\\nMy story is told from the perspective of the people who bought the village. In my version, they didn\\'t take the village apart for building material, but they decided to turn it into an open air museum.\\n\\nBecause I like open air museums.',},['Contrast']=0.630000,},[13]={['Groups']=0,['X']=65125.474093,['Color']=102439,['EffectType']=8501,['Id']=1334,['SizeZ']=190,['Yaw']=4.712389,['Y']=10352,['SizeY']=190,['SizeX']=202,['Alpha']=0,['Roll']=0,['Pitch']=1.570971,['Z']=47625.435715,['MetaData']={['title']='small, crumpled note',['message']='Achim,\\n\\nI\\'m definitely not a scaredy-cat.\\n\\nBut what you have proposed has nothing to do with a normal test of courage.\\n\\nI climb the highest tree to get you a crow egg without any problems, or steal the most beautiful apple from Mrs. Nebgen\\'s garden.\\n\\nI am not afraid to pray alone at midnight on a moonless night on God\\'s Acre.\\n\\nBut to ask me to look for the cave and to enter it is completely wrong.\\n\\nYou know as well as I do that no one who ever entered the cave has come out. \\nThe people just disappear.\\nNot only physically, but also from people\\'s stories and minds.\\n\\nElisabeth\\'s family never mentions her again.\\nIt\\'s as if you\\'ve only had six children all along.\\n\\nAnd if you ask about her, you only get a bitter look as if you had cursed loudly in church.\\n\\nIf you don\\'t think of something more reasonable, I\\'ll tell Mr. Stiel of your gang of robbers, and he\\'ll spank your buttocks so that you can\\'t sit until Christmas mass.\\n\\nLet me know what\\'s next,\\n\\nHilmar',},['Contrast']=1,},[14]={['Groups']=0,['Color']=606060,['EffectType']=599,['Id']=1335,['SizeZ']=50.679612,['Yaw']=6.094690,['Y']=10143.339806,['SizeY']=50.679612,['SizeX']=41,['Alpha']=0.820000,['Roll']=0,['Pitch']=5.082399,['Z']=48710.854063,['X']=66195.499885,['Contrast']=0.460000,},[15]={['Groups']=0,['Color']=60716,['EffectType']=599,['Id']=1336,['SizeZ']=50.679612,['Yaw']=6.094690,['Y']=10142.339806,['SizeY']=50.679612,['SizeX']=41,['Alpha']=0.700000,['Roll']=0,['Pitch']=5.082399,['Z']=48710.535785,['X']=66195.520243,['Contrast']=0.010000,},[16]={['Groups']=0,['X']=66193.671781,['Color']=102439,['EffectType']=8502,['Id']=1337,['SizeZ']=70,['Yaw']=6.021386,['Y']=10142,['SizeY']=70,['SizeX']=46.456456,['Alpha']=0,['Roll']=0,['Pitch']=5.235988,['Z']=48717.028819,['MetaData']={['title']='little piece of paper',['message']='*This little piece of paper has been folded several times, wrapped in an oilcloth and hidden under a stone.\\nStill, it feels clammy*\\n\\nMy dear Jupp,\\n\\nI miss you terribly. And not knowing where you are breaks my heart.\\n\\nI hope you\\'re just hiding from your father again.\\nI remember all too well the bruises after he beat you up last time.\\n\\nHopefully you\\'ll check our secret mailbox and find this letter.\\n\\nPlease answer me here if you can. I\\'m so worried about you.\\n\\nYesterday I tried to ask your mother where you are as inconspicuously as possible.\\n\\nShe just said that you would feel better now.\\nAnd the soil and the crop too.\\n\\nWhen I just looked at her, completely puzzled, she told me that I shouldn\\'t stare so stupidly and that your father had taken you into the cave.\\nAnd that I shouldn\\'t keep asking such stupid questions, now everything would be fine again.\\n\\nPlease, please, please give me a sign of life.\\n\\nAny.\\n\\nThe main thing is that I know you\\'re okay.\\n\\nI\\'ll send you a thousand kisses,\\n\\nAnna',},['Contrast']=1,},[17]={['Groups']=0,['Color']=337899,['EffectType']=880,['Id']=1338,['SizeZ']=20,['Yaw']=5.180137,['Y']=10693,['SizeY']=20,['SizeX']=20,['Alpha']=0.600000,['Roll']=0,['Pitch']=0,['Z']=47427.078140,['X']=62887.907178,['Contrast']=0.390000,},[18]={['Groups']=0,['Color']=337899,['EffectType']=880,['Id']=1339,['SizeZ']=7,['Yaw']=4.813618,['Y']=10695,['SizeY']=7,['SizeX']=9,['Alpha']=0.600000,['Roll']=0,['Pitch']=0.474730,['Z']=47424.906892,['X']=62883.748313,['Contrast']=0.390000,},[19]={['Groups']=0,['Color']=337899,['EffectType']=880,['Id']=1340,['SizeZ']=8,['Yaw']=5.445427,['Y']=10694,['SizeY']=8,['SizeX']=8,['Alpha']=0.600000,['Roll']=0,['Pitch']=0.635300,['Z']=47432.755829,['X']=62887.146480,['Contrast']=0.410000,},[20]={['Groups']=0,['Color']=458099,['EffectType']=886,['Id']=1341,['SizeZ']=4.128906,['Yaw']=2.282891,['Y']=10690,['SizeY']=4.128906,['SizeX']=4,['Alpha']=0.590000,['Roll']=0,['Pitch']=6.021386,['Z']=47429.293114,['X']=62883.215729,['Contrast']=0.410000,},[21]={['Groups']=0,['Color']=43411,['EffectType']=937,['Id']=1342,['SizeZ']=340,['Yaw']=4.715880,['Y']=10320,['SizeY']=340,['SizeX']=522,['Alpha']=0.700000,['Roll']=0,['Pitch']=1.570970,['Z']=48212.171860,['X']=63365.840160,['Contrast']=1.160000,},[22]={['Groups']=0,['X']=62467.202674,['Color']=132323,['EffectType']=8503,['Id']=1343,['SizeZ']=30,['Yaw']=3.832743,['Y']=10476,['SizeY']=30,['SizeX']=26.456456,['Alpha']=1,['Roll']=0,['Pitch']=1.553343,['Z']=50266.873725,['MetaData']={['message']='\\n\\nThe Westerwald is famous for its Kannenbaeckerland.\\n\\nThe largest clay deposit in Europe was found in this area.\\n\\nSince the 16th century, it has been used to make the in Germany well-known grey and blue Westerwald Pottery.\\n\\nIn addition to pot making, they made clay tobacco pipes, which were once common.\\n\\nThe Kannenbaeckerland was described as such in the late 18th century, although the records show that pottery had been continuously made here since at least 1402.\\n\\nIn the area where my family lived, there were no potters.\\n\\nBut I remember seeing the pots in a lot of places there.\\n\\nIt\\'s still part of the Westerwald and its culture.\\n\\nAnd it is something you can sell to tourists.\\n\\nI still don\\'t own this kind of pottery.\\n\\nIt is maybe better to sell it to tourists.',['title']='Somehow, history is always connected with old pottery',},['Contrast']=0.990000,},},['Version']=1773,['TS']=1712267787,}"
