R["oh__@arantirr"]="{['TS']=1710101737,['na']={[56]={['D']='Wanted to build a home for my Breton Vampire Arcanist; part of my return to ESO Housing. Always appreciate feedback if you enjoy my work. :) Hopefully you have as much fun visiting as I did building!',['N']='Fortress of Dusk',['C']=1.017000,['O']=19624,},[89]={['D']='This keeps popping off the hub, sorry yall!!',['N']='Cathedral St Kaladas',['C']=1.026000,['O']=18956,},[61]={['D']='Inspired by the Elven palace in the show Witcher: Blood Origin, this is my first build in a few years to celebrate getting back into ESO housing. Hope you enjoy it as much as I enjoyed building it!',['N']='Xin\\'trean Palace',['C']=1.020000,['O']=19624,},[54]={['D']='Oops! Didn\\'t realize this fell off EHT! Hope you guys enjoy :)',['N']='Vamidium Sanctuary',['C']=1.026000,['O']=18890,},[86]={['D']='Al Garlas-lattia, Ayleidoon for \"The glorious shining cavern\", is the hidden stronghold of Ithalia\\'s Ayleid followers. Hidden for centuries after the Alessian rebellion, this last remnant of a forgotten God continues to shine bright, safeguarding secrets unknown. \\n\\nKeeping with my love of all things Ayleid, please enjoy my newest project and interpretation as we gear up for the exciting new chapter! :D',['N']='Al Garlas-lattia',['C']=1.017000,['O']=19792,},},['Key']='oh__@arantirr',['Version']=1773,}"
