R["oh__@yunarou"]="{['TS']=1685129868,['Key']='oh__@yunarou',['Version']=1773,['eu']={[20]={['N']='«Lunar Light»',['O']=19491,['D']='There are all kinds of rumors about this Teahouse, that strange sounds, growls, screams are heard there, that someone sees some strange silhouettes, shadows, someone claims that he entered the Teahouse in one place and left in another! And some say it\\'s all nonsense and there is nothing strange there. However, locals avoid the place. But most agree that the food and service here is excellent, the smell is always very pleasant, and the light does not hurt your eyes. The very place to relax.\\r',['C']=1.007000,},[3]={['O']=19503,['N']='Lunar Light bathroom',},},}"
