R["fx__eu__@mashia__14"]="{['Version']=1773,['TS']=1684655631,['Effects']={[1]={['Yaw']=0.335103,['Color']=333162,['SizeZ']=50,['Alpha']=1,['Pitch']=4.715880,['X']=44371.239071,['SizeX']=38.456456,['Contrast']=1.130000,['MetaData']={['message']='The flame-haired male threw his cheese at me. I made sure he won\\'t do that again, but he is annoying. He screams a lot (mostly about cheese) and has tantrums since I put him on the no-carb diet. Maybe the side effects are bigger than calculated. The dark female seems to be ok, she sometimes begs for meat, fish, or even an egg, but she seems to like her fruits and vegetables. She got a bit thin though. I had to punish her once when she tried to exchange some potatoes with the flame-haired for cheese.\\nI still hope these experiments will help.\\n\\nAt the moment, I can\\'t notice an improvement. There are differences, though. The taste was the first difference I could recognize. To be honest, I prefer the traditional argonian diet with a big variety of wildlife and selected vegetables and herbs. The scrawny long-ear seems to endure it well. At least he doesn\\'t complain and seems to enjoy broth-soup and trodh.\\nI still feel uncomfortable with actually cooking, so I mostly skip the hot part. High-spirited, I tried Beetle Puffs, but standing in front of the fire isn\\'t something I want to repeat. My skin seemed to crack immediately in the heat, and I still smell a bit smoky.\\nThe second difference is the blood renewal. It is a bit difficult to compare because one is female, and they are always on the slower side, but it got really slow in the last weeks. Maybe vegan is not the right choice, but I still have to determine how it will work out in the end. I see no big difference between both males, maybe the red haired lacks a bit flavour. A downside, to be honest.\\nAnd the last change I can recognize is the temper. The female seems to have lost a lot of energy and is quieter now. The flame haired got a lot louder and seems to be upset the whole time. And the scrawny long-ear got broody.',['title']='Diet Diary',},['Z']=51944.535738,['Groups']=0,['Id']=1279,['SizeY']=50,['Roll']=0,['Y']=11618,['EffectType']=8502,},[2]={['Yaw']=3.141593,['Color']=496999,['SizeZ']=47,['Alpha']=1,['Pitch']=4.722861,['X']=46162.931048,['SizeX']=37.456456,['Contrast']=1,['MetaData']={['message']='Still difficult. I am very pleased that the saplings seem to survive now, but the change of the leaf colour still... touches something deep inside me. It should be a lush and vibrant green, not this intense red. I can\\'t get used to it. In all of my memories, the trees are still green, and it is like the wind is singing through their leaves. Here, I can\\'t hear the song of the wind. But there is something else, like the groan of old wood. They aren\\'t old yet, but somehow�� there is something. And they got demanding. I could throw a fresh corpse to their roots every other day, but I still refuse to. Of course, they need blood with their new condition now, but it shouldn\\'t dominate everything.\\nAnd there is still no connection. The last time I felt the hist, was the day I got attacked by this... thing. My hope is fading, but I still hope I can reconnect. I miss the connection. Without it, I feel so lonely and vulnerable.\\n\\nIt was so logical... If I change, the hist had to change the same way, and it would be right again. Why does it change so much? And why does it frighten me? Maybe I didn\\'t find the right blood yet. Perhaps it just requires another diet. ',['title']='Lab book',},['Z']=51902.403068,['Groups']=0,['Id']=1280,['SizeY']=47,['Roll']=0,['Y']=11798,['EffectType']=8503,},[3]={['Yaw']=4.471534,['Color']=81341,['SizeZ']=33,['Alpha']=1,['Pitch']=5.019567,['X']=45510.560481,['SizeX']=28.456456,['Contrast']=1,['MetaData']={['message']='I didn\\'t sleep well the last days. There seem to be different reasons. First, I shouldn\\'t have changed the water keg for a beer keg just because it was easier to get. My guests got a lot easier to handle since then, but the noise seems to have increased with the cheeriness. And it affects me, albeit second hand. I can\\'t think straight, my head aches, and I sometimes forget what I wanted to do. A few days more and I will forget who I am. And I am in no position where I should forget anything. I still sleep next to the bones of my egg-brothers and -sisters, but I can\\'t remember how they looked like. Maybe less pale than I am now. Somewhere there should be even the skull of the thing which attacked me. Smashed and shattered - but I feel no longer hate for it. The past seems to be so far away... I don\\'t know why I took the effort to take everything down to my new place. Possibly because I can\\'t sleep without the last links to my past?\\n\\nMy Grave-stake looks so small and empty... should I have continued to carve my experiences after my death? It doesn\\'t feel right. But this grave-stake is no longer a representation of the person I am. Confusing. It should tell everybody who I am.\\n\\nAnd there is an even more important reason. I see more lights outside at night. The neighbours got suspicious. Perhaps too many people missing, maybe the screams. Doesn\\'t matter, I have to do something about.\\n\\nMy last idea with inviting some guys to this new card game didn\\'t work out. I made mistakes. Maybe I shouldn\\'t have put cheese with raw fish as dinner on the table. Or insist that everybody drinks red wine. Dunno, humans are so difficult to understand.',['title']='Diary',},['Z']=50851.832206,['Groups']=0,['Id']=1281,['SizeY']=33,['Roll']=0,['Y']=12036,['EffectType']=8501,},[4]={['Yaw']=4.188790,['Color']=395259,['SizeZ']=33,['Alpha']=1,['Pitch']=4.712564,['X']=44386.116939,['SizeX']=26.456456,['Contrast']=1.420000,['MetaData']={['message']='I am tired after a hard day of working in the sun, so I will go to bed early in the evening - like always.\\nAnd all the house cleaning! It is like you leave a room just for an hour to cook a hot meal above lots of fire, and when you return everything is dusty and full of spider webs. I should get a maid.\\nBut I don\\'t know who. I don\\'t think my neighbours are trustworthy. I hear a lot of screams at night, yet I don\\'t believe they have mating season all the time. Most look like they never have mating season.\\nAs a very social and friendly person, I talked with my neighbours and heard that several people disappeared during the nighttime. Of course, I didn\\'t see anything because I always sleep at night. But still...\\nTake this Fredrik for an example. He breeds pigs. When I take a stroll in the sun to visit him, all his pigs stare at me with their hungry, omnivore faces. I never see him feed them, and still they thrive. Could it be the source of the screams? Is there a connection to the missing people?  Is Fredrik a dark sorcerer and turns people into pigs? He looks like he would do something like that. You cannot even see if he smirks because he covered his face with hair.\\nAnd then there is old Betsy. Lives completely alone with her nine grandchildren and takes care of them. Always busy tidying up her house, cleaning kids and preparing meals for them. How can she afford to raise so many demanding little creatures? She has no time to earn money, but there is always something cooking in the kitchen and I can smell the scent of well-prepared meat. Where does she get it from? Has it to do with all the missing persons? As far as I can count, there are still all nine brats jumping around her... Somebody should investigate them. As an upstanding citizen, I am very concerned.',['title']='Beloved Diary',},['Z']=49131.641068,['Groups']=0,['Id']=1282,['SizeY']=33,['Roll']=0,['Y']=12386,['EffectType']=8503,},[5]={['Alpha']=1,['Yaw']=5.497787,['Color']=999999,['Pitch']=0.785398,['X']=44428.577513,['SizeZ']=200,['Contrast']=4,['Groups']=0,['Z']=48731.695961,['SizeX']=220,['Id']=1283,['SizeY']=200,['Roll']=0,['Y']=12853,['EffectType']=609,},[6]={['Alpha']=1,['Yaw']=0.261799,['Color']=999999,['Pitch']=0,['X']=43990.145555,['SizeZ']=320,['Contrast']=4,['Groups']=0,['Z']=48597.087378,['SizeX']=460,['Id']=1284,['SizeY']=320,['Roll']=0,['Y']=12653,['EffectType']=609,},[7]={['Alpha']=1,['Yaw']=5.759587,['Color']=999999,['Pitch']=1.574287,['X']=44430.653231,['SizeZ']=160,['Contrast']=4,['Groups']=0,['Z']=48728.523142,['SizeX']=240,['Id']=1285,['SizeY']=160,['Roll']=0,['Y']=12413,['EffectType']=609,},[8]={['Alpha']=1,['Yaw']=1.919862,['Color']=848799,['Pitch']=0.436332,['X']=43556.349444,['SizeZ']=260,['Contrast']=4,['Groups']=0,['Z']=49204.757377,['SizeX']=300,['Id']=1286,['SizeY']=260,['Roll']=0,['Y']=12872,['EffectType']=609,},[9]={['Alpha']=1,['Yaw']=4.101524,['Color']=999999,['Pitch']=0.261799,['X']=44841.821877,['SizeZ']=320,['Contrast']=4,['Groups']=0,['Z']=49260.725496,['SizeX']=360,['Id']=1287,['SizeY']=320,['Roll']=0,['Y']=12833,['EffectType']=609,},[10]={['Alpha']=1,['Yaw']=1.919862,['Color']=999999,['Pitch']=0.349066,['X']=44095.389883,['SizeZ']=280,['Contrast']=4,['Groups']=0,['Z']=49409.183665,['SizeX']=340,['Id']=1288,['SizeY']=280,['Roll']=0,['Y']=13551,['EffectType']=609,},[11]={['Alpha']=1,['Yaw']=4.527384,['Color']=999999,['Pitch']=0,['X']=44860.492106,['SizeZ']=200,['Contrast']=4,['Groups']=0,['Z']=49103.688179,['SizeX']=260,['Id']=1289,['SizeY']=200,['Roll']=0,['Y']=13374,['EffectType']=609,},[12]={['Alpha']=1,['Yaw']=0.349066,['Color']=999999,['Pitch']=0,['X']=43924.656870,['SizeZ']=200,['Contrast']=4,['Groups']=0,['Z']=47676.494981,['SizeX']=320,['Id']=1290,['SizeY']=200,['Roll']=0,['Y']=13232,['EffectType']=609,},[13]={['Alpha']=1,['Yaw']=0.010472,['Color']=999999,['Pitch']=0,['X']=44096.835016,['SizeZ']=180,['Contrast']=4,['Groups']=0,['Z']=47744.579102,['SizeX']=260,['Id']=1291,['SizeY']=180,['Roll']=0,['Y']=13071,['EffectType']=609,},[14]={['Yaw']=4.712389,['Color']=696968,['SizeZ']=300,['Alpha']=0,['Pitch']=0,['X']=45759,['SizeX']=130,['Contrast']=1,['MetaData']={['message']='The air is so stuffed with various layers of smell that you have the feeling of walking through liquid instead of gas. There are big windows, but they are closed, so there is no air movement and even the sunlight flows with cautious sluggishness through the dusty windows.\\nThe smell of decay nearly knocks you off your feet.\\nIt is no simple smell, it is a complex composition of intertwined layers of various stages of decomposition.\\nNo way you get used to that.\\nBut after taking a couple of breaths, you are able to identify different components. Underlaying is a very earthlike tone, like rotten vegetation. You identify the unpleasant odour of hydrogen sulphite, which playfully surrounds you. But what alarms you most is a metallic smell, so strong that you can nearly taste it.\\nYou stop breathing. Much better.',['name']='The Smell',},['Z']=51622,['Groups']=0,['Id']=1294,['SizeY']=300,['Roll']=0,['Y']=11504,['EffectType']=5018,},[15]={['Yaw']=4.014257,['Color']=102439,['SizeZ']=342,['Alpha']=0,['Pitch']=4.712564,['X']=45538.936269,['SizeX']=326.456456,['Contrast']=0.010000,['MetaData']={['message']='Freedom awaits you.\\n\\nOnly a few steps... a trapdoor... and you are surrounded by the fresh air of the forest.\\n\\nYou cover your head and hands with the lab coat and scurry into the deep shadows of the forest.\\n\\nA last look back... it was a great place.\\n\\nYou will miss it.\\n\\nAnd it will take some time to find a good place again.\\n\\nBut you will.\\n\\nYou always survived.\\n\\nA lot more than everybody else.',['title']='Trapdoor',},['Z']=50998.832175,['Groups']=0,['Id']=1295,['SizeY']=342,['Roll']=0,['Y']=12466,['EffectType']=8501,},[16]={['Yaw']=0,['Color']=696968,['SizeZ']=235,['Alpha']=0,['Pitch']=0,['X']=43597,['SizeX']=90,['Contrast']=1,['MetaData']={['message']='The moment you leave the old Druidic shrine, a complete different world welcomes you. Well, it is not a very warm welcome, but the air changed at least. You smell earth, fresh moss and water soaked flora. There is still a hinge of hydrogen sulphite, lazy leaking out of the shallow pools below you.\\n\\nThe dirty water looks unpleasant, but your bigger concern is the sunlight, which flows unfiltered through the lush vegetation. Instinctively you wrap your lab coat around the bare scales of your head and hands and run through the sunlight into the safety of the small house in front of you.',['name']='The Sunlight',},['Z']=49660,['Groups']=0,['Id']=1297,['SizeY']=235,['Roll']=0,['Y']=12117,['EffectType']=5010,},[17]={['Yaw']=1.570796,['Color']=197999,['SizeZ']=95,['Alpha']=0,['Pitch']=0,['X']=43248.893234,['SizeX']=50,['Contrast']=1,['MetaData']={['message']='You are too late.\\nThe bulky guy in heavy armour forced himself through the front door.\\nYou squint your eyes, all you can see is his strong shape and the twinkle of the well looked after metal of his armour in the sun.\\nOh, Sunlight... It swirls unfiltered around him like a playful kitten and floods the whole kitchen. The big door doesn\\'t protect you any longer, and you jump with a hiss back as you feel your scales burning from the light.\\nThe armoured guy reacts fast, faster than you thought. Instead of drawing the exaggeratedly huge sword on his side, he reaches for a crossbow and loads it proficiently.\\nIn the distance, you hear the barks of dogs and the sound of a hunting group.\\nThere is no way you will survive this fight.\\nGame over.',['name']='The Guard',},['Z']=47922.346904,['Groups']=0,['Id']=1298,['SizeY']=95,['Roll']=0,['Y']=13160,['EffectType']=594,},},}"
