s Notes S. Amelle V12',['message']='Gabrielle, regarding the spellscar shard.  It isn\\'t completely inert... yet.  While I do agree it is degrading since it\\'s removal, the one in my basement has occasionally flared with arcane energy.  Nothing exceptionally dangerous but I\\'ve moved it to the center of the floor in my workroom in the basement so it doesn\\'t start anything on fire. \\nI\\'ve also done the same thing with the Vulk\\'esh egg because as Reginus has pointed out it is still putting out quite a bit of heat.  Gabrielle please let me know if  any of your university friends have any new insights.\\n\\nAfter examining the broken Ansei sword that was dropped off, I believe that while it is fairly old, it is a copy made in the last few hundred years not an original Yokudan one.  Amalien or Urgon, any chance either of you could pin down when this was forged more precisely?',},['Color']=728699,['Yaw']=3.070034,['SizeZ']=30,['Groups']=0,['Y']=7110,['Pitch']=4.712564,['EffectType']=8503,['Alpha']=1,['Roll']=0,['Id']=1052,['SizeX']=26.456456,['Contrast']=1.930000,['Z']=73692.477521,['SizeY']=30,['X']=65193.587427,},},['TS']=1674529473,['Version']=1769,}"
