R["oh__@belzenefka"]="{['eu']={[32]={['C']=1.051000,['D']='This small cottage was built in the mountain valley away from people\\'s eyes. Enjoy the sound of nature and relax',['O']=19352,['N']='Mountain house',},[81]={['C']=1.020000,['D']='A Blackreach cave with a small dwemer ruin.\\n\\nBest to see at night.',['O']=18983,['N']='Blackreach Cave',},[9]={['C']=1.031000,['D']='',['N']='Hidden garden',['O']=19378,},[28]={['C']=1.023000,['D']='A small daedric library located inside an abandoned castle.\\n\\n(If you have trouble entering the house angle your camera to the bottom)',['O']=18945,['N']='Daedric Library',},[11]={['C']=1.021000,['D']='Welcome to the holiday house of Isobel Veloise. This place is her private retreat from her everyday knightly responsibilities. ',['O']=19378,['N']='Isobel\\'s retreat',},[44]={['C']=1.050000,['D']='Welcome to the luxurious apartment located in Vvardenfell, it\\'s been recently bought and renovated by a rich Imperials who use it now as their holiday suite. \\nYou may visit it during their absence and enjoy your stay. But shhh don\\'t tell anyone!',['O']=19378,['N']='Lux Suite',},[49]={['C']=1.020000,['D']='A cozy home for a witch and alchemy shop.',['O']=19378,['N']='Witch House',},[14]={['C']=1.026000,['D']='Piece of Evergloam',['O']=19059,['N']='Evergloam',},[15]={['C']=1.020000,['D']='Deep in the enchatned forest lays an old tower. Building is currently occupied by a Sorceress and her new apprentice. Tower might be old but has everything a modern woman and her crow friend might need:  big library, kitchen with alchemy stand,  bathroom, bedroom and of course a secret room for not so safe artifacts (also a strange inhabitant that may or may not be welcome here).\\n',['O']=19356,['N']='Sorcerer\\'s Tower',},},['Key']='oh__@belzenefka',['TS']=1674340970,['Version']=1771,}"
