R["fx__na__@arantirr__54"]="{['TS']=1630940341,['Version']=1760,['Effects']={[1]={['Pitch']=1.221730,['Yaw']=1.404990,['Groups']=0,['X']=66372.632629,['Y']=61656,['Z']=82142.600535,['Alpha']=1,['SizeZ']=30,['Contrast']=1,['MetaData']={['message']='Venturing back into Wrothgar, and seeing the incredible city of Orsinium inspired me to delve outside of my Ayleid comfort-zone and try something new. This is my take based off of the painting displayed behind. A fun mix of Dwemer (minus the icky steampunk aspects I\\'m not a fan of) and Orcish architecture, in an ambitious attempt to outdo ZOS\\'s Arkthzand Library. Hope ya\\'ll enjoy it as much as I have!\\n\\nIn terms of background, I have devoted this vault/library to Azura, since dawn and dusk are the periods in which this build is the most beautiful.',['title']='Welcome',},['SizeX']=26.456456,['EffectType']=8501,['SizeY']=30,['Color']=969798,['Id']=1429,['Roll']=0,},},}"
