R["oh__@sharalene"]="{['TS']=1664335138,['Key']='oh__@sharalene',['Version']=1769,['na']={[25]={['D']='Just a quiet country house i built for a contest that had a limit of 100 spaces. I just wanted to show people what I could do with the limitations and still make it cozy and inexpensive.',['C']=1.047000,['O']=19263,['N']='Sharalene\\'s Home',},[90]={['D']='Within a portal of the Deadlands lies a mysterious Orc refuge of plant and animal. With beloved greenhouses of flower, mushroom, cacti and fern, a marketplace with food and treasures alike, a Pet Showcase where you can sit and watch unique animals at play and the Dreaded Lava Boats of Mehrune Dagon where you can watch a Daedric Prince fight, enjoy the ambience and beauty of a refuge from Oblivion!',['C']=1.031000,['O']=19263,['N']='Deadlands Plot',},[13]={['D']='This is my Argonian Love Nest for Valentines\\'s Day being an Argonian myself. Let the Hist flow through you and may you mutiply with cool waters on your scales! =)',['C']=1.022000,['O']=19263,['N']='Elden Root House',},[70]={['D']='This house features a quiet Church, a restaurant and kitchen with a beautiful view, and my Zap Garden with an Undaunted Room! Don\\'t steal my gold or you\\'ll get zapped!!!',['C']=1.021000,['O']=19263,['N']='Rimmen Temple',},[31]={['D']='This was my very first house and it is my Map House. I collected and finished all 36 zones when i didn\\'t even have eso+. Im very proud of it.',['C']=1.025000,['O']=19263,['N']='Hammerdeath House',},},}"
