R["fx__na__@buckwilddog__94"]="{['Version']=1767,['Effects']={[1]={['Z']=92587,['Yaw']=0.759218,['Contrast']=1,['Pitch']=5.148721,['Alpha']=1,['Id']=1207,['X']=90192,['Color']=990000,['Groups']=0,['Y']=51547,['SizeY']=30,['SizeX']=26.456456,['Roll']=0,['MetaData']={['title']='Captain\\'s Final Journal',['message']='After years of searching, I\\'ve come closer than ever to finding the bounty I had set my eyes on since I was just a child gazing out on the Topal Bay from my home in Senchal, yet it still remains just out of reach... With the three keys artifacts lost to the sea, there\\'s no way I\\'ll be able to finish what we started on my own in my current state. \\n\\nIt took us years to find this place, and the rival pirates who sank us didn\\'t seem to want anything more than the gold and rations we had aboard the ship at the time. Even with everything they wanted, they still murdered my crew and sank my beloved ship. I was lucky to make it out alive. \\n\\nI\\'m the only one left now, my friends and loyal crew lost to the depths in the wake of the attack, and without a healer, my wounds likely won\\'t leave me far behind them. I can only hope they forgive me for dragging them all the way out here for a failed journey. \\n\\nSome captain I am right? \\n\\nAt least the view is nice, gazing upon a glittering hoard of treasure likely brought here over the course of many decades, or possibly even centuries by those who preceded us. \\n\\nBut it was never about the gold to begin with was it? \\n\\nIf anyone happens to find this journal after I\\'m dead and gone, and you have an interest in uncovering the secrets of this spire, the log of our voyage can be found in the captains cabin of my sunken ship, safely protected by the magics of this strange place. \\n\\nIt\\'s getting harder to move, and I fear my wounds will get the better of me before any help arrives, but to whoever may be reading this, I wish you the best of luck if you decide to pick up where we left off, and hopefully succeed where we failed...',},['EffectType']=8503,['SizeZ']=30,},[2]={['Z']=72390,['EffectType']=8503,['X']=72579,['Pitch']=4.799655,['Groups']=0,['Roll']=0,['Id']=1208,['Color']=102439,['SizeY']=30,['Y']=51712,['MetaData']={['title']='Ships Log Part 1',['message']='Day One:\\nMy crew and I leave Senchal today, we\\'re on our way to Shimmerene to pick up our benefactor and the three items of importance to our voyage.\\n\\nDay Three:\\nWe made port in Woodhearth to pick up more provisions and supplies for the journey. The bosmer aren\\'t to fond of anything grown, so the meats we picked up will have to do for the rest of the journey, at least until our next stop after the island.\\nAt least the stop also allowed the crew to stretch their legs, as some of them arent as accustomed to life on the sea.\\nAdded to ships hold:\\n7 servings of Roast Pig\\n5 whole cooked chickens\\n4 Beef roasts\\n\\nDay Four:\\nWe picked up our benefactor Cirion in Shimmerene, who brought aboard the items we requested of him. I\\'ve read about them in my research, but they were certainly much more impressive looking in person.\\n\\nAdded to ships hold:\\n\\n1 Enchanted pearl, encased in a large clam.\\n\\n1 Redguard Pirate lord\\'s Sword With a miniaturized black soul gem inlaid into it\\'s guard.\\n\\n1 Golden colored crystal, with a faint glow to it that seems to brighten to the touch.\\n\\nDay Five:\\nAfter yet another night of rest, we set sail from Shimmerene towards The Systress, where we should be able to get our bearings toward the spire.',},['SizeX']=26.456456,['Alpha']=1,['Contrast']=1,['Yaw']=0.825541,['SizeZ']=30,},[3]={['Z']=72365,['EffectType']=8503,['X']=72622,['Pitch']=4.799655,['Groups']=0,['Roll']=0,['Id']=1209,['Color']=102439,['SizeY']=30,['Y']=51707,['MetaData']={['title']='Ships Log Part 2',['message']='Day Seven:\\nPassing by The Systress, we get our new heading as suggested by our navigator, and we move along, making haste to the spire.\\n\\nDay Eight:\\nAfter just over a week of sailing, we finally dock within the island of the spire! \\n\\nDay Eight (Cont.):\\nIt\\'s an Ambush!! At least 3 ships flying black flags must have followed us here from the Systress. Definitely a guild of rival pirates around these parts judging by the matching flags and sails. \\n\\nWe\\'re outnumbered, and decided as a crew that we won\\'t be making it out of here without giving up some items of value, so we\\'ve decided to dump the three arifacts into the bay before our ship can be ransacked. \\n\\nIt\\'s better to make sure these pirates can\\'t use these items to get deeper into the spire. \\n\\nAt least we have a small chance of coming back for a retrieval expediton with a larger crew and vessel.\\n\\nWith the three artifacts at the bottom of the Spire\\'s ruin, and our voyage all but in vain, all we can hope now is that they spare us our lives...',},['SizeX']=26.456456,['Alpha']=1,['Contrast']=1,['Yaw']=0.651008,['SizeZ']=30,},[4]={['Z']=72428,['EffectType']=8503,['X']=72464,['Pitch']=4.886922,['Groups']=0,['Roll']=0,['Id']=1210,['Color']=990004,['SizeY']=30,['Y']=51726,['MetaData']={['title']='Captain\\'s Journal',},['SizeX']=26.456456,['Alpha']=1,['Contrast']=1,['Yaw']=1.740093,['SizeZ']=30,},},['TS']=1650759454,}"
