R["oh__@caythwyn"]="{['Version']=1767,['TS']=1638733065,['na']={[43]={['O']=18966,['N']='Wayward Hermitege',['D']='The Wayward Hermitage is a Botanical Farm focusing on Alchemy Ingredients, a Niche often overlooked in the heartlands of Indoril\\'s Garden, freshly recolonized by a sworn-member of House Indoril. Complete with a quaint bungalow, Triune Shrine with Guest Quarters, Stables, and three distinct biomes for the cultivation of Morrowind\\'s unique Flora.\\r\\n\\r\\nPainstaking detail was taken to associate every flora object placed with a floral source of Ingredients featured in TES3: Morrowind. Come explore!',['C']=1.007000,},[19]={['O']=18966,['N']='Sanctum Ordinitor',['D']='A Tribunal Temple Ritual Chamber dedicated to the Donning and Doffing of the Liturgical Vestments of the Temple\\'s Holy Warrior-Priests, the Ordinators.\\n\\nA Triune Shrine stands at the heart of the build, where a pedastal kneels before Nerevar Moon-And-Star, surrounded by the 11 Saints of the Tribunal invoked in the Donning Ritual.',['C']=1.007000,},},}"
