R["fx__na__@pika002__56"]="{['Effects']={[1]={['Roll']=0,['Yaw']=4.705408,['SizeY']=30,['SizeX']=26.456456,['Y']=10078,['MetaData']={['title']='Recipe: Blood cake',['message']='Fresh blood, very fresh, no longer than 3 minutes after extraction.\\nCrownberry paste, lots of it.\\nTop quality moon sugar.\\nTop quality flour. Always top quality.\\nMost important, sprikle of soul gem powder.\\nThis contains the essence of those who suffering in deadric lands.\\nMix every thing togather, gently. Then bake with all the precious love.\\n\\nAll my vampire guests love my special blood cake. Even humans too.\\nSadly for my human guests, they were never the same after eating it.\\nGood thing is no need to prepare beds, since they don\\'t sleep in coffin.',},['SizeZ']=30,['EffectType']=8502,['Pitch']=4.673992,['Contrast']=1,['Color']=102439,['Alpha']=1,['Id']=1005,['Z']=30869.096377,['X']=26929.599682,['Groups']=0,},[2]={['Roll']=0,['Yaw']=1.570796,['SizeY']=30,['SizeX']=26.456456,['Y']=10043,['MetaData']={['title']='The Abomination',['message']='Day1: A cute little meat ball wriggling arround.\\n\\nDay5: Getting bigger.\\n\\nDay10: Getting even bigger.\\n\\nDay15: Are these...feet or tentacles?\\n\\nDay20: Successfully injected with magical elements. NOW IT\\'S ALIVE.\\n\\nDay25: It tore open one of my servant then devoured him.\\n\\nDay30: Keep growing. It seems to have minds of its own.\\n\\nDay35: I took it for a walk down to the waterfall. It tried to escape. When i try to stop, it unleashed it\\'s power upon me. A huge explosion. Luckly I escaped. I\\'ve never been afraid of my own creation. But this one...is a bit scary. I can feel its anger, agony, madness swelling inside. I\\'m thrilled. This is the true abomination of dark magic I\\'ve been working on. Ironically, I have to seal it, for good. ',},['SizeZ']=30,['EffectType']=8502,['Pitch']=4.715880,['Contrast']=1,['Color']=20022,['Alpha']=1,['Id']=1007,['Z']=29669.922748,['X']=31042.969751,['Groups']=0,},[3]={['Roll']=0,['Yaw']=4.101524,['SizeY']=30,['SizeX']=26.456456,['Y']=10577,['MetaData']={['title']='Fertilizer for underground gardening',['message']='Testing two different fertilizer here. \\nThese are specialy made with essence of the living.\\n\\nThe green one works just right. Flowers with even brighter color.\\n\\nThe red one works excellent too...in a different way. Looks like I over tuned it a little bit... ',},['SizeZ']=30,['EffectType']=8502,['Pitch']=4.799655,['Contrast']=1,['Color']=102439,['Alpha']=1,['Id']=1008,['Z']=38647.004446,['X']=16673.640058,['Groups']=0,},},['TS']=1630107060,['Version']=1759,}"
