poop in 30 minute furnishings challenges, and just for being an all around awesome guy.  \\n\\nYou should know, I have not gone cow tipping since I\\'ve known you.. though there\\'s no promises the next time I go back to Mississippi.\\n\\nKeep being amazing you.\\n\\nRespectfully,\\nEclaveth aka Hootems',},['SizeZ']=50,['X']=68292,},[57]={['Groups']=0,['SizeY']=30,['Id']=1714,['Contrast']=1,['EffectType']=8501,['Pitch']=0,['Color']=995444,['SizeX']=46,['Alpha']=1,['Y']=20126,['Z']=61153,['Roll']=1.570971,['Yaw']=1.570796,['MetaData']={['title']='Chicken, Kitten, and Table .. oh my!',['message']='This table is dedicated to Mr. Snugs.  If you are reading this message, you must give Mr. Snugs some chicken.. you won\\'t like it if he doesn\\'t have any chicken.  Also, enjoy the table..\\n\\nThank you, Mr. Snugs, for always being supportive and a strong shoulder to lean on.\\n \\nAlways,\\nKim',},['SizeZ']=30,['X']=70119,},[58]={['Groups']=0,['SizeY']=30,['Id']=1715,['Contrast']=1,['EffectType']=8501,['Pitch']=1.570971,['Color']=999300,['SizeX']=26.456456,['Alpha']=1,['Y']=20138,['Z']=61057,['Roll']=0,['Yaw']=6.005678,['MetaData']={['title']='FijiDacu',['message']='Dedicated to a wonderful hot tub ducking banana.. Miss Fiji, oh yeah and that Dacu guy too.\\n\\nAll jokes aside, Miss Fiji and Dacu you two are so lovely.  I always look forward to chatting with you guys.  I appreciate the work lurks, the hot tub ducking bananas, and of course the dance floor boogies.  Now.. I bet you can\\'t find what I changed in your craft hall..\\n\\nLove,\\nKim',},['SizeZ']=30,['X']=67112,},},}"
