 well.',},['SizeY']=34,['Pitch']=0.066323,['SizeZ']=34,['Alpha']=1,},[98]={['Yaw']=2.078687,['Groups']=1,['SizeX']=30.456456,['Y']=29082,['Z']=71421,['Roll']=0,['Color']=996159,['Contrast']=0.840000,['EffectType']=8501,['Id']=1104,['X']=71747,['MetaData']={['title']='Quartermaster\\'s Crafting Update',['message']='For basic crafting needs, all stations are located on the Quartermaster\\'s dock. There is an additional provisioning station at the Mess Hall.\\n\\nFor crafting specific gear sets, you can visit the TMV Attunable Crafting Outpost located way up high in some fucking mountains. Here is a list of the current sets available - we\\'re just getting started on this, so this list will grow:\\n\\nFULL SETS (all 4 stations):\\n\\nHunding\\'s Rage\\nLaw of Julianos\\nNew Moon Acolyte\\n\\nPARTIAL SETS:\\nShacklebreaker',},['SizeY']=34,['Pitch']=0.066323,['SizeZ']=34,['Alpha']=1,},[99]={['Yaw']=2.078687,['Groups']=1,['SizeX']=30.456456,['Y']=29082,['Z']=71342,['Roll']=0,['Color']=991288,['Contrast']=0.840000,['EffectType']=8501,['Id']=1105,['X']=71686,['MetaData']={['title']='Contributing to TMV!',['message']='As our numbers grow, we are expanding things rapidly! One of our key focuses right now is to build out the auxiliary guild base (The TMV Attuned Crafting Outpost). See the other note here on the board for what is there currently, but if you want to help us get their faster, read on!\\n\\nYou can contribute to our growth in a lot of ways. But right now, the main need is to acquire more attuned crafting stations. You can get them at various guild traders, or by earning master writ vouchers and buying them from the Master Writ merchant.\\n\\nWe need all 4 types! Blacksmithing, Clothing, Woodworking, and Jewelry. Don\\'t actually attune them to a given set, though - I need them blank so I can start filling in gaps and completing full sets of stations. :)\\n\\nIf you aren\\'t in a position to do that, don\\'t worry. There are other ways to help! We don\\'t have any \"guild membership dues\", but feel free to send me any spare gold you have, or just deposit it in the TMV guild bank.\\n\\nAnd of course, keep spreading the word to other veterans that you may run into during your tour of duty in Tamriel!\\n\\nThanks!\\n@marneman',},['SizeY']=34,['Pitch']=0.066323,['SizeZ']=34,['Alpha']=1,},[100]={['Yaw']=2.680826,['Groups']=0,['SizeX']=26.456456,['Y']=28963,['Z']=76346,['Roll']=0,['Color']=309970,['Contrast']=0.700000,['EffectType']=8502,['Id']=1112,['X']=68250,['MetaData']={['title']='Current Orders',['message']='Private Jackson\\'s Moon Sugar Order Log\\n\\nNOTE: I am using their real names here, because if I get caught, I ain\\'t going down alone!\\n\\nPrivate Olaffson, 2 stones worth, PAID\\nPrivate Lennifer, 1 stone worth, PAID\\nCorporal Ignus, 6 stones worth, NOT PAID!',},['SizeY']=30,['Pitch']=4.625123,['SizeZ']=30,['Alpha']=1,},[101]={['Yaw']=1.062906,['SizeX']=1000,['Y']=29155,['Z']=68620,['Roll']=0,['Color']=999999,['Groups']=0,['EffectType']=943,['SizeY']=1000,['X']=70288,['Id']=1113,['Contrast']=1,['Pitch']=0,['SizeZ']=1000,['Alpha']=1,},},['HouseId']=71,['World']='na',['Version']='16.2.1',},[3]={['TS']=1616170125,['Effects']={[1]={['Yaw']=3.373721,['SizeX']=275,['Color']=58399,['Y']=20816,['Z']=157470,['Roll']=0,['SizeY']=35,['MetaData']={['message']='Hunding\\'s Rage',},['EffectType']=4403,['Contrast']=0.560000,['SizeZ']=35,['Id']=1095,['Groups']=0,['Pitch']=0,['X']=164462,['Alpha']=1,},[2]={['Yaw']=5.206317,['SizeX']=275,['Color']=218599,['Y']=20736,['Z']=155239,['Roll']=0,['SizeY']=35,['MetaData']={['message']='Law of Julianos',},['EffectType']=4403,['Contrast']=0.560000,['SizeZ']=35,['Id']=1096,['Groups']=0,['Pitch']=0,['X']=164573,['Alpha']=1,},[3]={['Yaw']=4.506440,['SizeX']=600,['Color']=999999,['Y']=28237,['Z']=154006,['Roll']=0,['SizeY']=600,['MetaData']={['houseid']=71,['owner']='@marneman',},['EffectType']=4500,['Contrast']=1,['SizeZ']=600,['Id']=1097,['Groups']=1,['Pitch']=0,['X']=166407,['Alpha']=1,},[4]